void start_program() {
    while (1) {

        print_blue_line();
        printf("\n-- Challenge Menu --\n");
        print_blue_line();

        printf("\t1) Overflow\n");
        if (challenge_unlocked >= 1) printf("\t2) Leak\n");
        if (challenge_unlocked >= 2) printf("\t3) Calculate PIE Address\n");
        if (challenge_unlocked >= 3) printf("\t4) Ret2Win\n");

        print_blue_line();

        printf("Enter choice >>> ");
        fflush(0);
        int choice;
        scanf("%d", &choice);
        getchar();

        switch (choice) {
            case 1:
                overflow();
                break;
            case 2:
                if (challenge_unlocked >= 1) leak();
                else printf("<<< Unlock previous challenges first.\n");
                break;
            case 3:
                if (challenge_unlocked >= 2) address();
                else printf("<<< Unlock previous challenges first.\n");
                break;
            case 4:
                if (challenge_unlocked >= 3) ret2win();
                else printf("<<< Unlock previous challenges first.\n");
                break;
            default:
                printf("<<< Invalid choice.\n");
        }
    }
}

